INSERT INTO `arbitrary_page` VALUES (4,1,14,'Family','Starting to look pretty real, isn\'t it? That rumored X10 Mini Pro replacement seems to be gallivanting about in China again; this time it\'s not turned on, but the point is that it\'s out there and certainly doesn\'t seem knockoff-y to be a fake. \r\n\r\nFor what it\'s worth, the original X10 Mini series has been one of the few relatively bright points in Sony Ericsson\'s Android lineup thus far, so we\'re pretty stoked to see that they appear to be taking another shot at the diminutive form factor -- let\'s just hope those wild GPU results we saw last time hold up by the time it\'s at retail.\r\n\r\nGeez, it\'s been a long weekend of almost incessant Galaxy Tab II teasing, but the time has come: Samsung\'s finally releasing the official details of its 10.1-inch, Android Honeycomb tablet to the world. Contrary to the leaks, the tablet is called the Galaxy Tab 10.1','2011-01-19 21:24:35','2011-02-14 23:45:21'),(3,1,14,'About Us','President Obama has signaled that he will give the United States Commerce Department the authority over a proposed national cybersecurity measure that would involve giving each American a unique online identity. Other candidates mentioned previously to head up the new system have included the NSA and the Department of Homeland Security, but the announcement that the Commerce Department will take the job should please groups that have raised concerns over security agencies doing double duty in police and intelligence work. So anyway, what about this unique ID we\'ll all be getting? Well, though details are still pretty scant, U.S. Commerce Secretary Gary Locke, speaking at an event at the Stanford Institute, stressed that the new system would not be akin to a national ID card, or a government controlled system, but that it would enhance security and reduce the need for people to memorize dozens of passwords online. Sorry, Locke, sounds like a national ID system to us. Anyway, the Obama administration is currently drafting what it\'s dubbed the National Strategy for Trusted Identities in Cyberspace, which is expected at the Department of Commerce in a few months. We\'ll keep you posted if anything terrifying or cool happens.\r\n','2011-01-19 21:24:25','2011-01-22 03:13:33'),(5,1,15,'Our Story','Here are our storys togethere....ahdhdhdhdhdhde','2011-01-21 21:33:52','2011-01-21 21:33:52'),(6,566708666,20,'About Us','Timothy and Janice \r\nand \r\nJonathan \r\ninvite you to the ceremony that \r\nwill make them \r\nbrothers and sisters as \r\ntheir parents \r\nDebbie Nantucker \r\nand \r\nMarcus Witherall \r\nunite as one in marriage \r\non Saturday, the first of March \r\nat ten o\'clock in the morning \r\ntwo thousand fourteen \r\nWorld Christian Church \r\n101 North Boulevard \r\nTopeka, Kansas \r\n\r\nReception immediately following the ceremony','2011-03-21 20:55:42','2011-03-24 19:13:55'),(7,566708666,20,'Family','Jan Livingston\r\nSerena Thomas \r\nDan Thomas \r\nrequest the honour of your \r\npresence \r\nat the marriage of their parents \r\nSusan F. Leathers \r\nand \r\nMitchell R. Thomas \r\non Saturday, the seventeenth day \r\nof May \r\ntwo thousand fourteen \r\nat eleven o\'clock in the morning \r\nat Wood Falls Club \r\n12 Woodtree Lane \r\nWood Falls, Indiana\r\n\r\nLisa Valerie Governs \r\nand \r\nTodd L. Sanders \r\nrequest the honor of your \r\npresence \r\nat their marriage \r\non May twenty-fourth \r\ntwo thousand fourteen \r\nat five o\'clock in the afternoon \r\n5785 Cypress Drive \r\nCypress, Kansas','2011-03-21 20:55:42','2011-03-24 19:13:59'),(8,573228966,21,'About Us',NULL,'2011-03-23 02:05:57','2011-03-23 02:05:57'),(9,573228966,21,'Family',NULL,'2011-03-23 02:05:57','2011-03-23 02:05:57'),(10,566708666,22,'About Us',NULL,'2011-03-24 01:43:13','2011-03-24 01:43:13'),(11,566708666,22,'Family',NULL,'2011-03-24 01:43:13','2011-03-24 01:43:13'),(12,566708666,23,'About Us',NULL,'2011-03-24 01:43:25','2011-03-24 01:43:25'),(13,566708666,23,'Family',NULL,'2011-03-24 01:43:25','2011-03-24 01:43:25'),(14,573228966,24,'About Us',NULL,'2011-03-24 01:59:13','2011-03-24 01:59:13'),(15,573228966,24,'Family',NULL,'2011-03-24 01:59:13','2011-03-24 01:59:13'),(16,566708666,25,'About Us',NULL,'2011-03-28 01:56:03','2011-03-28 01:56:03'),(17,566708666,25,'Family',NULL,'2011-03-28 01:56:03','2011-03-28 01:56:03'),(18,566708666,26,'About Us',NULL,'2011-03-28 02:05:09','2011-03-28 02:05:09'),(19,566708666,26,'Family',NULL,'2011-03-28 02:05:09','2011-03-28 02:05:09'),(20,566708666,27,'About Us','How we met+-+-+-+-+-+-Some might say it was Destiny. Others would say her perfume danced it\'s way on the breeze to me. She was walking ahead of me on her way to lunch. There was a strong breeze as she rounded a corner and it made a client folder that she was holding fly away. Her provocative scent said hello to me first and I noticed beautiful woman who was trying to chase after pieces of paper in 4\" heels. I was able to catch the last page for her as she walked up to me. I smelled that sweet inviting scent again and had to return the greeting. I told that I was very fond of her perfume and that for being her hero she owed me a cup of coffee. Since then we seldom have left each others side.+-+-+-+-+-+-One weird fact+-+-+-+-+-+-We both broke our left arms trying to skateboard as children.+-+-+-+-+-+-Our Favorite Activity+-+-+-+-+-+-Hiking the joy of having your best friend with you as you work up a respectable sweat. As you come up to the top of the ridge and look out at the ocean and see endless possibility and look over and see each other you get reaffirmation that anything is possible+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-We have the best, families, friends, and dogs in the world. You guys ROCK!','2011-03-28 02:28:17','2011-09-19 23:17:20'),(21,566708666,27,'Family','Smiths+-+-+-+-+-+-The smith family is Welch and came to the his country in the early 1700s. After the Revolutionary War, they migrated westward into Ohio and them up to Indiana. In the early 1900s the family moved to San Francisco, California.+-+-+-+-+-+-Monroe+-+-+-+-+-+-Love my family with my hold heart.  My family is Joy to love!','2011-03-28 02:28:17','2011-10-02 20:12:46'),(22,573228966,28,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2011-04-02 02:15:58','2011-04-02 02:24:56'),(23,573228966,28,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb+-+-+-+-+-+-','2011-04-02 02:15:58','2011-04-02 02:25:01'),(24,1772633097,29,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2011-04-02 21:34:43','2011-04-02 21:34:52'),(25,1772633097,29,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb+-+-+-+-+-+-','2011-04-02 21:34:43','2011-04-02 21:35:00'),(26,573228966,30,'About Us','How we met stuff+-+-+-+-+-+-This is my other thing +-+-+-+-+-+-we both ate ribs+-+-+-+-+-+-and we liked them+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2011-04-06 00:30:48','2011-04-06 00:32:15'),(27,573228966,30,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb+-+-+-+-+-+-','2011-04-06 00:30:48','2011-04-06 00:32:21'),(28,573228966,31,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2011-04-06 02:32:12','2011-04-06 02:32:12'),(29,573228966,31,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','201