wer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-02 19:42:30','2012-01-02 19:42:30'),(205,2147483647,119,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-02 19:42:30','2012-01-02 19:42:30'),(206,2147483647,120,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-02 21:04:10','2012-01-02 21:04:10'),(207,2147483647,120,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-02 21:04:10','2012-01-02 21:04:10'),(208,1082454201,121,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-03 13:31:04','2012-01-03 13:31:04'),(209,1082454201,121,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-03 13:31:04','2012-01-03 13:31:04'),(210,1516350048,122,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-07 00:12:41','2012-01-07 00:12:41'),(211,1516350048,122,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-07 00:12:41','2012-01-07 00:12:41'),(212,555725617,123,'About Us','Our Story+-+-+-+-+-+-It started with a glance, then a dance, then a kiss. October 7, 2006 was the first time Jeremy and Melissa laid eyes on each other, and it was love at first site. While they both arrived to this destination via mutual friends this chance encounter at a downtown Cleveland night club changed the course of their lives forever. They exchanged phone numbers, and over the next couple weeks they continued to call and see each other. They hung out and watched movies, went out on dates, and continued to fall for each other.\n\nOn one of their early dates, Melissa and Jeremy went out to dinner with people from Melissas work to celebrate a co workers birthday. They both drove separately and met each other at the restaurant. After having a good time enjoying the food and conversation, it was time to go. Only problem was Melissa just realized she had locked her keys in the car. They entered Jeremys car as he called the police to come bust in to her red Buick. Jeremy started the conversation with the Dispatcher My girlfriend locked her keys in her car, dispatch requested to speak to her to get the rest of the info, Jeremy handed her the phone and as he listened to Melissa talk to dispatch, he realized what he had just said. He was nervous of the implications of those words, but also realized that it felt so natural to say, but it just hadnt been said yet. Jeremy got his reassurance when he heard Melissa tell dispatch she was sitting in her boyfriends car while they waited for the police to arrive. After she hung up, they stared at each other, both grinning from ear to ear. Jeremy asked did we just say what I think we said? To which Melissa replied I think we did, what do you think? Jeremy looked into her eyes and Melissa looked back into Jeremys and then came their first kiss as Boyfriend and Girlfriend.\n\nFor the next six months a relationship blossomed, but all the while Melissa was planning her move to finish school in Charlotte, NC, a plan that had been in motion prior to meeting Jeremy. They both knew that they were feeling something that they had never felt before, and Jeremy wanted to do something really special for her before she moved to Charlotte. Jeremy surprised Melissa with a trip to Las Vegas in February 2007. It was his favorite place to travel and wanted to experience the bright lights and Vegas nights with the woman he was falling in love with. They spent 5 days and 4 nights in Vegas, a place completely foreign to Melissa, but the bright lights, the magic of David Copperfield, the jaw dropping acrobatics in Cirque De Solei, winning $500 on a Deal or No Deal slot machine, and watching Jeremy clean up at the black jack tables showed Melissa why Jeremy loves that town so much. Melissa was feeling her love bloom at all time high levels, and as this trip came to an end, a new part of her life awaited her in Charlotte.\n\nAfter moving to Charlotte in March of 2007, Melissa and Jeremy were now both assured that the feelings they felt for each other were love. The kind of love that once youve had seems impossible to live without. That combined with the distance between them, accelerated a process that most couples expand over years, but Jeremy and Melissa were already sure that they wanted to spend the rest of their lives together. Jeremy proposed on June 30, 2007 while Melissa was in town during a break from school. Melissa accepted the proposal and the yes brought them closer than ever. While she still had to go back to Charlotte, some of their separation anxiety was at ease as they were both now clear of whom they saw their futures with. Melissa continued school in Charlotte, but continued to realize that she missed Jeremy and her family just too much for her to bear. She decided to leave NC later in the year to get a head start on the new life that lay ahead of her.\n                                                                         Melissa moved back to Ohio in January of 2008. Melissa was very excited to move back, but she and Jeremy both decided on a longer engagement so that she could fully focus on finishing school and getting her degree. For the next 3 years Melissa worked hard, focused, and graduated from Virginia Marti College with a degree in Interior Design in June of 2011. So proud of his future wife, Jeremy and Melissa spent the next few months finalizing their wedding date, and will be honored for you to join them on May 12, 2012, at Normandy Party Center in Wickliffe, OH, as they celebrate their relationship and finally make their future official.+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-+-','2012-01-08 01:35:01','2012-01-08 13:31:39'),(213,555725617,123,'Family','The Charlillo Family+-+-+-+-+-+-+-+-+-+-+-+-The Michael Family+-+-+-+-+-+-Family 2s blurb','2012-01-08 01:35:01','2012-01-08 13:33:04'),(214,2147483647,124,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-09 00:40:42','2012-01-09 00:40:42'),(215,2147483647,124,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-09 00:40:42','2012-01-09 00:40:42'),(216,2147483647,125,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-09 00:40:58','2012-01-09 00:40:58'),(217,2147483647,125,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-09 00:40:58','2012-01-09 00:40:58'),(218,2147483647,126,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-Answer','2012-01-09 00:42:00','2012-01-09 00:42:00'),(219,2147483647,126,'Family','Family 1s Name+-+-+-+-+-+-Family 1s blurb+-+-+-+-+-+-Family 2s Name+-+-+-+-+-+-Family 2s blurb','2012-01-09 00:42:00','2012-01-09 00:42:00'),(220,2147483647,127,'About Us','How we met+-+-+-+-+-+-Answer+-+-+-+-+-+-One weird fact+-+-+-+-+-+-Answer+-+-+-+-+-+-Our favoriate Activity+-+-+-+-+-+-Answer+-+-+-+-+-+-Something we would like to share+-+-+-+-+-+-An